window.bookSummaryJSON = "<p><b>From <i>New York Times</i> bestselling author Steven Erikson comes a new SF novel of devil-may-care, near calamitous, and downright chaotic adventures through the infinite vastness of interstellar space.</b> </p> <p>The continuing adventures of the starship A.S.F. <i>Willful Child</i>. Its ongoing mission: to seek out strange new worlds on which to plant the Terran flag, to subjugate and if necessary obliterate new life-forms, to boldly blow the... </p> <p>And so we join the not-terribly-bright but exceedingly cock-sure Captain Hadrian Sawback and his motley crew on board the Starship <i>Willful Child</i> for a series of devil-may-care, near-calamitous and downright chaotic adventures through \"the infinite vastness of interstellar space.\" </p> <p>The <i>New York Times</i> bestselling author of the acclaimed Malazan Book of the Fallen series has taken his lifelong passion for <i>Star Trek</i> and transformed it into a smart, inventive, and hugely entertaining spoof on the whole mankind-exploring-space-for-the-good-of-all-species-but-trashing-stuff-with-a-lot-of-high-tech-gadgets-along-the-way, overblown adventure. The result is an SF novel that deftly parodies the genre while also paying fond homage to it. </p>"; 
